import React,{ useEffect } from 'react';
import {CategoryService} from "../../../service/Categories/CategoryService";
import axios from "axios";

const EventCategories = () => {

    useEffect(() => {
        const path = "http://64.23.188.226:8001/api/v1/categories?all=1"

        axios.get(path).then((data)=> console.log(data)).catch(function (error) {
            console.log(error)}
        )
    }, []);

    return (
        <>
            <div className='mx-auto w-[1000px] font-inter'>
            </div>
        </>
    )
}

export default EventCategories;

